import { useContext } from "react";
import { Titles } from "./App";
import "./main.css";

function ThreadTitles() {
  const titles = useContext(Titles);
  const titlesDesc = titles[1];


  return (
    <>
      <div>
        {Object.values(titlesDesc).map((val, index) => {
          return (
            <span key={index}>
              {val.title}({val.count}),
            </span>
          );
        })}
      </div>
    </>
  );
}
export default ThreadTitles;
